        "title": "Why is a Circle 360 Degrees, Why Not a Simpler Number, like 100?",
        "description": "A circle is 360 degrees But have you ever thought why is a circle not a simpler number, like 10 degrees or 100 degrees? As it turns out 360 is actually a very good number. From a purely mathematical standpoint, a number like 10 or 100 would have been more inconvenient.\n\nYou see, the number 360 is divisible by every number from 1 to 10, aside from 7. In addition to that, 360 has 24 divisors. This is the highest number of divisors for any positive whole number up to its own value of 360. This is just one of the reasons why a circle is 360 degrees. \n\nIn this video, we have discussed some other reasons that make 360 an idea number for calculations.\n\n#circle #geometry #mathematics\n\nSUBSCRIBE to get more such science videos! \nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\nFollow us on Twitter! \nhttps://twitter.com/abc_science\n\nFollow us on Facebook!\nhttps://facebook.com/sciabc\n\n\nFollow us on Instagram!\nhttps://www.instagram.com/scienceabcofficial/ \n\nFollow us on LinkedIn!\nhttps://www.linkedin.com/company/scienceabc\n\nFollow our Website!\nhttps://www.scienceabc.com",
