        "channelId": "UCUL-7A4MtbEfHgU0beYHz1A",
        "title": "El Gran Wyoming: El Mundo que Queremos CajaCanarias 2013",
        "description": "La undécima edición del ciclo \"El Mundo que Queremos\", que anualmente organiza la Fundación CajaCanarias dentro la programación del Otoño Cultural, celebró un coloquio que, bajo el lema general \"saqueo a la democracia\", ha centrado su propuesta dialéctica y de reflexión. En esta ocasión, y bajo la dirección y moderación del escritor y periodista Fernando Delgado, se reunieron en el Espacio Cultural CajaCanarias de Santa Cruz de Tenerife tres certeros analistas de la sociología cotidiana y sus consecuencias con respecto a los efectos que la situación socioeconómica actual produce en la ciudadanía: el escritor Juan José Millas; José Chamizo, ex Defensor del Pueblo de Andalucía; y José Miguel Monzón, \"El Gran Wyoming\", disertarán acerca del \"abuso de poder y respuesta popular\". \nJosé Miguel Monzón (El Gran Wyoming).- Madrileño  del barrio de la Prosperidad, hijo de farmaceúticos, es un personaje polifacético que se licenció en medicina y ha ejercido de médico, humorista, actor, guionista, músico y actualmente, presentador de uno de los espacios de humor e información que más impacto están teniendo en la audiencia \"El intermedio\" (La Sexta). El Gran Wyoming, abreviado a veces como Gran Wyoming o Wyoming. Ha sido también columnista de Público y sus artículos pueden leerse de nuevo en el diario de Internet Infolibre.\n\nA lo largo de toda su carrera ha recibido innumerables premios, entre otros, el Premio Ondas por su trabajo en El Intermedio y este mismo año el Premio al mejor presentador de Televisión. Como escritor es autor de: Un vago, dos vagos, tres vagos (Temas de Hoy, 1990), Te quiero personalmente (Anagrama, 1993), Las aventuras del mapache (Alfaguara juvenil,1997), El niño que soñaba despierto (Agruparte, 2000) y la Colección de Cuentos Musicales La mota de polvo.",
